import React , {useState} from "react";
import LargeComponent
 from "../ItemsCollection/LargeComponent";
const Result =(props)=>{
    const [items,filtereditems] = useState(props.items);
    const OnFilterHandler =(event) => {
        const year = event.target.value;
        if (year === '2019') {
            filtereditems(props.items[3]);
        }
        else if (year === '2020') {
            filtereditems(props.items[2]);
        }
        else if (year === '2021') {
            filtereditems(props.items[1]);
        }
        else {
            filtereditems(props.items[0]);
        }
    }
    return (
        <div>
            <LargeComponent items= {items} /*onExecute={ExectionHandler}*//>
        </div>
    );
};
export default Result;
